import React, { useState } from 'react'

function App() {

  const [file, setfile] = useState(null);
  const [threshold, setThreshold] = useState(0.8);
  const [ratio, setRatio] = useState(4);
  const [targetlevel, setTargetlevel] = useState(0.9);

  const  handleSubmit = async (e) => {
    e.preventDefault(); //リロード防止

    const formData = new FormData();
    formData.append('file', file);
    formData.append('threshold', threshold);
    formData.append('ratio', ratio);
    formData.append('target_level', targetlevel);

    try{
      const response = await fetch('https//localhost:5000/upload',{
        method: 'POST',
        bosy: formData,
    });

    if (response.redirect) {
      // flaskがリダイレクトしたらそのURLに移動
      window.localStorage.href = response.url;
    }
  } catch (error){
    console.error('送信に失敗しました', error);
  }
  };

  return (
    <div>
      <h1>これはReactで作ったページです</h1>
    </div>
  );
}

export default App;
